import React, { Component } from 'react';
import './Contact.css';


class Contact extends Component{

    state = {
        name: undefined,
        email: undefined,
        subject: undefined,
        message: undefined
    };


    render(){

        return(
            <div>
                <form>
                    <div><input type ='text'/></div>
                    <div><input type ='text'/></div>
                    <div><input type ='text'/></div>
                    <div><input type ='text'/></div>
                    <div><input type ='text'/></div>
                </form>
            </div>
        );
    }
};

export default Contact;
